import React from "react";

export default function Profile(props) {
  return (
   <header>
     <img src="" alt=""></img>
     <h1>Welcome user</h1>
     <p>Stats</p>
     <p>You have ran 10 runs.
     For a total of 100 minutes and 100 km.</p>
   </header>
  )
}
